package common.customer.model;import common.base.BaseModel;import common.enums.Gender;import jakarta.persistence.Column;import jakarta.persistence.Entity;import jakarta.persistence.Table;@Entity@Table(name = "customers")public class CustomerModel extends BaseModel {    @Column(name = "full_name")    private String fullName;    @Column(name = "mobile")    private String mobile;    @Column(name = "email_id")    private String emailId;    @Column(name = "active")    private boolean active;    @Column(name = "gender")    private Gender gender;    @Column(name = "password")    private String password;    public String getFullName() {        return fullName;    }    public void setFullName(String fullName) {        this.fullName = fullName;    }    public String getMobile() {        return mobile;    }    public void setMobile(String mobile) {        this.mobile = mobile;    }    public String getEmailId() {        return emailId;    }    public void setEmailId(String emailId) {        this.emailId = emailId;    }    public boolean isActive() {        return active;    }    public void setActive(boolean active) {        this.active = active;    }    public Gender getGender() {        return gender;    }    public void setGender(Gender gender) {        this.gender = gender;    }    public String getPassword() {        return password;    }    public void setPassword(String password) {        this.password = password;    }    public CustomerModel(String fullName, String mobile, String emailId, boolean active, Gender gender, String password) {        this.fullName = fullName;        this.mobile = mobile;        this.emailId = emailId;        this.active = active;        this.gender = gender;        this.password = password;    }    public CustomerModel() {    }    @Override    public String toString() {        return "CustomerModel{" +                "fullName='" + fullName + '\'' +                ", mobile='" + mobile + '\'' +                ", emailId='" + emailId + '\'' +                ", active=" + active +                ", gender=" + gender +                ", password='" + password + '\'' +                ", id=" + id +                ", createdAt=" + createdAt +                ", createdBy=" + createdBy +                ", updatedAt=" + updatedAt +                ", updatedBy=" + updatedBy +                '}';    }}